Movie Info: 101 Chodyangal (English: 101 Questions) is a 2013 Indian Malayalam film written and directed by Sidhartha Siva. At the 60th National Film Awards the film won the awards for Best First Film of a Director and Best Child Artist (Minon). It also won the Silver Crow Pheasant Award for Best Feature Film (Audience Prize) at the 18th International Film Festival of Kerala.

The film is set in Kaviyoor, Tiruvalla, director's hometown in Kerala, which inspired the film. The story revolves around a school assignment given to a class V student to frame 101 questions.


